import React from 'react';
import Styles from './Card.module.css';
import {Button} from '@material-ui/core';
const Card = (props)=>{
    const {src} = props;
    return (
        <div>
            <img className = {Styles.container} src = {src} height = '200px'>
            </img>
            <Button className = {Styles.GuardarButton} variant="contained" color="secondary">
                Guardar
            </Button>
        </div>
    )
}
export default Card;
